import React from "react";
import { Card, Button } from "react-bootstrap";
import { Link } from "react-router-dom";
function FeaturesCard(props) {
  // const handel={
  //   onclick,
  // }

  return (
    <>
      <div>
        <h3>Demo</h3>
        <div className="m-5">
          <Card style={{ width: "15rem" }}>
            <Card.Img
              variant="top"
              src={props.Img}
              style={{ width: "238px", height: "165px" }}
            />
            <Card.Body>
              <Card.Title>{props.Title}</Card.Title>
              <Card.Text>
                {/* <li>Alstroemeria</li>
              <li>Calla Lily</li>
              <li>Daisy</li>
              <li>Gardenia</li>
            <li>Carnation</li> */}
                <li><b>Type:</b>&nbsp;{props.Text}</li>
                <li><b>Colour:</b>{props.color}</li>
              </Card.Text>
              <Button variant="primary" href="/">
                <Link to={props.Link} style={{color:'white'}}>More Details</Link>
              </Button>
            </Card.Body>
          </Card>
        </div>
      </div>
    </>
  );
}

export default FeaturesCard;
